import React, { Component } from "react";
import { Route, Router, Link } from "react-router-dom";
// import Proof from "./Subcomponents/Proof";
// import Anagram from "./Subcomponents/Anagram";
import "./Projects.css";

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { anagram: false, proof: false, home: true };
  }
  onClick = e => {
    if ([e.target.name] !== "anagram") {
      this.setState({ anagram: false });
      console.log("worked1");
    } else {
      this.setState(prevState => ({
        anagram: !prevState.anagram
      }));
    }
    if ([e.target.name] == "proof") {
      this.setState({ proof: false });
      console.log("worked2");
    } else {
      this.setState(prevState => ({
        proof: !prevState.proof
      }));
    }
    if ([e.target.name] !== "home") {
      this.setState({ home: false });
      console.log("worked3");
    } else {
      this.setState(prevState => ({
        home: !prevState.home
      }));
    }
  };
  render() {
    return (
      <div className="projectMain">
        <div className="sidebar">
          <button className="projectButton" name="home" onClick={this.onClick}>
            My Projects
          </button>
          <ul>
            <li>
              <button
                className="sideName"
                name="anagram"
                id="anagramButton"
                onClick={this.onClick}
              >
                Anagram Generator
              </button>
            </li>
            <li>
              <button
                className="sideName"
                name="proof"
                id="proofButton"
                onClick={this.onClick}
              >
                Proof Technology Webpage
              </button>
            </li>
          </ul>
        </div>
        <div className="mainItem">
          <div className="itemImage">test</div>
        </div>
      </div>
    );
  }
}
export default Projects;
